import { createRouter,createWebHistory } from "vue-router";

import HomeView from "@/components/Dashboard/HomeView.vue";
import HomeBody from "@/components/Dashboard/HomeComponents/HomeBody.vue";
import HomeProglang from "@/components/Dashboard/HomeComponents/HomeProglang.vue";
import HomeSetting from "@/components/Dashboard/HomeComponents/HomeSetting.vue";
import HtmlCodeEditor from "./components/Dashboard/HomeComponents/ProgLangComponents/HtmlCodeEditor.vue";

import HtmlGameRoute from "./router/HtmlGameRoute";
import CssGameRoute from "./router/CssGameRoute";
import JsGameRoute from "./router/JsGameRoute";
const MainRoute = createRouter({
    history:createWebHistory(),
    routes:[
        {
            path:'/setting',
            component:HomeSetting
        },
        {
            path:'/html-css-js-editor',
            component:HtmlCodeEditor
        },
            ...HtmlGameRoute,
            ...CssGameRoute,
            ...JsGameRoute, 
        {
            path:'/',
            redirect:'/home',
            component:HomeView ,
            children:[
                {
                    path:'/home',
                    components:{
                        'home-body-route':HomeBody
                    }
                },
                {
                    path:'/language',
                    components:{
                        'home-body-route':HomeProglang
                    }
                }
            ]
        }

    ]
})

export default MainRoute;
